import './App.css';
import LoginForm from './components/Login';
import { BrowserRouter, Route, Routes } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/login' element={<LoginForm />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
